import React from "react";
import Typography from "@material-ui/core/Typography";
export default function SkillList(props){
    const setActive=(e)=>{
        const active = e.target.innerHTML;
        props.updateActive(active);
    }

    const x = props.skills.map(x=>
        <Typography className="skill" variant="button" component="body1">
        <button onClick={setActive}>{x.value}</button>
        </Typography>
    );
    return(
        <>
            <Typography className="skillList" variant="p" component="ul">
                {x}
            </Typography>
        </>
    );
}
